import logo from "./logo.svg";
import "./App.css";
import Footer from "./Components/Footers";
import React, { Component } from "react";
import { Nav, Navbar, NavDropdown } from "react-bootstrap";
//Non rappresenta documenti dinamicamente
//function App() {

//Funziona in modo dinamico e mi permette di mettere i props
class App extends Component {
  render() {
    return (
      <div classNameName="App">
        <Navbar bg="dark" variant="dark" expand="sm" collapseOnSelect>
          <Navbar.Brand>
            <img src={logo} width="40px" height="40px" /> Logo
          </Navbar.Brand>
          <Navbar.Toggle></Navbar.Toggle>
          <Navbar.Collapse>
            <Nav>
              <NavDropdown title="Products" bg="green" variant="dark">
                <NavDropdown.Item href="products/tea">Tea</NavDropdown.Item>
                <NavDropdown.Item href="products/tea">
                  Chocolate
                </NavDropdown.Item>
                <NavDropdown.Item href="products/tea">Cofee</NavDropdown.Item>
                <NavDropdown.Item href="products/tea">Other</NavDropdown.Item>
              </NavDropdown>
              <Nav.Link href="products">Blog</Nav.Link>
              <Nav.Link href="products">About us</Nav.Link>
              <Nav.Link href="products">Contact</Nav.Link>
            </Nav>
          </Navbar.Collapse>
        </Navbar>
        <div className="content">This is a content</div>
        <br></br>
        lorem
        <br></br>
        {/**  <Footer></Footer>*/}
        <div className="fixed-bottom">
          <div class="card-footer text-muted">2 days ago</div>
        </div>
      </div>
    );
  }
}

export default App;
